const LinkArray = [
    <Link to='/' > Home</Link >,
    <Link to='/about'>About</Link>,
    <Link to='/product'>Product</Link>,
    // <Link to='/product/:productId'>ProductId</Link>,
    // <Link to={{
    //     pathname: "/product",
